#include <string>
#include <vector>
#include <iostream>
#include <map>

using namespace std;

class Solution
{
public:
    vector<int> findSubstring(string s, vector<string> &words)
    {
        if (s.length() < words[0].length() * words.size())
        {
            return {};
        }

        vector<int> result;
        initWordsMap(words);
        processFind(result, s, 0, words[0].length() * words.size(), words[0].length());
        return result;
    }

    map<string, int> wordsMap;

    void initWordsMap(vector<string> &words)
    {
        for (string item : words)
        {
            if (wordsMap.find(item) == wordsMap.end())
            {
                wordsMap[item] = 0;
            }
            wordsMap[item]++;
        }
    }

    void processFind(vector<int> &result, string &s, int beginIndex, int subStringLength, int wordLength)
    {
        if (beginIndex >= subStringLength)
        {
            return;
        }

        int subStringBeginIndex = beginIndex;
        string subString = s.substr(subStringBeginIndex, subStringLength);
        while (subString.length() == subStringLength)
        {
            if (checkSubString(subString, wordLength))
            {
                result.push_back(subStringBeginIndex);
            }
            subStringBeginIndex += subStringLength;
            subString = s.substr(subStringBeginIndex, subStringLength);
        }
        processFind(result, s, beginIndex + 1, subStringLength, wordLength);
    }

    bool checkSubString(string &subString, int wordLength)
    {
        if (wordLength == 1 && wordsMap.size() == 1)
        {
            for (char item : subString)
            {
                if (item != (wordsMap.begin()->first)[0])
                {
                    return false;
                }
            }
            return true;
        }

        int beginIndex = 0;
        map<string, int> subStringWordMap;
        while (beginIndex < subString.length())
        {
            string wordFromSubString = subString.substr(beginIndex, wordLength);
            if (wordsMap.find(wordFromSubString) == wordsMap.end())
            {
                return false;
            }

            if (subStringWordMap.find(wordFromSubString) == subStringWordMap.end())
            {
                subStringWordMap[wordFromSubString] = 0;
            }
            subStringWordMap[wordFromSubString]++;
            beginIndex += wordLength;
        }

        if (subStringWordMap.size() != wordsMap.size())
        {
            return false;
        }

        for (const auto &item : subStringWordMap)
        {
            if (wordsMap[item.first] != item.second)
            {
                return false;
            }
        }

        return true;
    }
};

void printResult(vector<int> &result)
{
    for (int item : result)
    {
        cout << item << ",";
    }
    cout << endl;
}

void runTestCase(string input1, vector<string> input2)
{
    Solution solution;
    vector<int> result = solution.findSubstring(input1, input2);
    printResult(result);
}

